import teste from '@/services/teste.service'

const pageTwoModule = {
  state: () => ({
    teste: [],
    value_input: null
  }),
  mutations: {
    SET_USER(state, newState) {
      state.teste = newState;
    },
    SET_VALUE () {

    }
  },
  actions: {
    async httpUserDetailsGet({ commit }) {
      try {
        let data = await teste.userDetailGet();

        commit('SET_USER', data.data);
      } catch (err) {
        console.log(err);
      }
    },
  },
};

export default pageTwoModule
